import Navbar from "../components/Navbar";
import LoginBox from "../components/DetailsBox";
import "../login.css"
import DetailsBox from "../components/DetailsBox";


export default function Login(){
    let display = true;
    return (<div>
        <Navbar></Navbar>
        <DetailsBox display={display} func={"Login"}></DetailsBox>
    </div>);

}
